import React from 'react';
import Project from './Project.js';
import './Experience.css';

const projects = [
  {
    "img-src": "http://placekitten.com/g/200/200",
    "placeholder": "placeholder",
    "overview": "Star Wars coding kit at Kano Computing",
    "detail": "created a lightsaber",
    "tech": ["pixi.js", "Polymer.js"]
  }
];

function Experience() {
  return (
    <section className="Experience">
        <Project 
          img-src = {projects[0]["img-src"]}
          placeholder = {projects[0].placeholder}
          overview = {projects[0].overview}
          detail = {projects[0].detail}
          tech = {projects[0].tech}
        />
      </section>
  );
}

export default Experience;
